class Solution {
  int minSum(List<int> nums1, List<int> nums2) {
    int sum1 = nums1.reduce((a, b) => a + b);
    int sum2 = nums2.reduce((a, b) => a + b);
    int zeros1 = nums1.where((x) => x == 0).length;
    int zeros2 = nums2.where((x) => x == 0).length;

    if ((zeros1 + zeros2) == 0) {
      return sum1 == sum2 ? sum1 : -1;
    }

    int diff = (sum1 - sum2).abs();
    if ((zeros1 == 0 || zeros2 == 0) && diff % (zeros1 + zeros2) != 0) {
      return -1;
    }

    int minIncrement = diff ~/ (zeros1 + zeros2);
    int newSum = (sum1 > sum2 ? sum1 : sum2) + minIncrement * (zeros1 + zeros2);

    if ((diff % (zeros1 + zeros2) == 0) || (sum1 == sum2)) {
      return newSum;
    } else {
      return -1;
    }
  }
}
